def fibonacci(n):
            if n <= 1:
                return n
            else:
                return fibonacci(n-1) + fibonacci(n-2)

        def factorial(n):
            if n == 0 or n == 1:
                return 1
            else:
                return n * factorial(n-1)

        # Example usage
        print(f"Fibonacci(10): {fibonacci(10)}")
        print(f"Factorial(5): {factorial(5)}")

        # List comprehension
        squares = [x**2 for x in range(10)]
        print(f"Squares: {squares}")
